import React from 'react';
import {Link} from "react-router-dom";
import { Switch,Route, } from "react-router-dom";
import PostCabin from './PostCabin';
import {pageTransition} from '../../constants/constants'
import { motion } from "framer-motion";




export default function Admin (props) {
    return (
      <motion.div>
        <p>Hello from Admin</p>
        <Link to='/PostCabin'>
            <span>Legg til ny hytte</span>
        </Link>
        <Switch>
          <Route path='/Admin/Cabins' exact component={Admin} />
          <Route path='/Admin/PostCabin' component={PostCabin} />
        </Switch>
      </motion.div>
    )
}
